import React from 'react'

const Main = () => {
  return (
<div className='Main-con'>
    <button className='btn-get-users'>All Users</button>
    <button className='btn-get-products'>All Products</button>
    <button className='btn-get-orders'>Get Orders for User</button>
    <button className='btn-create-order'>Create New Order</button>
</div>

  )
}

export default Main
